        queryKey: ['products'],
        queryFn: async () => {
            const res = await fetch(`http://localhost:5001/myproducts?email=${user?.email}`, {
                headers: { 
                    authorization: `Bearer ${localStorage.getItem('arkDeals')}`
                }
            })
            const data = await res.json();
            return data;
        }
    })  
